import React from 'react'
import './../App.css'
const Pdf = ({pdf}) => {
    return (
        <div  className="task">
            <div className="items" >
                {/* <h2>{pdf.pdf_name}</h2>
                <a href={pdf.pdf_link}>{pdf.pdf_link}</a> */}
              <li > 
                <div id="row">
                  <a href={pdf.pdf_link} target="_blank" rel="noopener noreferrer">{pdf.pdf_name}</a>
                  <p>{pdf.pdf_date} </p>
                </div>
              </li> 
                {/* <p>{pdf.company_code+1}</p> */}
            </div>
        </div>
    )
}

export default Pdf
